import React from 'react'
import styled from 'styled-components'

export default function CommentItem ({comment}) {
    const Comment = styled.div`
        border: 2px solid black;
        margin:1em;
        display:flex;
        width:100%;
        justify-content:space-between;
    `
    return (
        <Comment >
            'id':{comment.id}
            'parent':{comment.parent}
        </Comment>
    )
}
